import React, { Component } from "react";
import "./Profile.css"; // Importez le fichier CSS pour les styles supplémentaires

class Profile extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div className="container-fluid py-5 position-relative">
                <img alt="" className="coverimg" src="images/coverimg.png" />
                <p className="text-white text-center display-1 py-3 position-absolute top-50 start-50 translate-middle" style={{ fontFamily: "cinematic", fontSize: "70px" }}>
                    Welcome to your profile <span style={{ color: "red" }}> Ala</span>
                </p>
            </div>
        );
    }
}

export default Profile;
